function sendAjaxGetRequestQueryParam(d,a,b,c){AJS.$.ajax({url:a,type:"get",contentType:"application/json",data:d,success:function(e){b(e)},error:function(e){c(e.responseText)}})}function sendAjaxGetRequestQueryParamNoAsync(d,a,b,c){AJS.$.ajax({url:a,type:"get",contentType:"application/json",data:d,async:false,success:function(e){b(e)},error:function(e){c(e.responseText)}})}function sendAjaxPostRequest(d,a,b,c){AJS.$.ajax({url:a,type:"post",dataType:"json",contentType:"application/json",data:JSON.stringify(d),async:true,success:function(e){b(e)},error:function(e){c(e.responseText)}})}function sendAjaxPostRequestNoAsync(d,a,b,c){AJS.$.ajax({url:a,type:"post",dataType:"json",contentType:"application/json",data:JSON.stringify(d),async:false,success:function(e){b(e)},error:function(e){c(e.responseText)}})};